import React, {Document} from 'react';
import Layout from '../../Layout';
import {BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Component } from 'react';

// ROUTE CONTROLLER
import Pengunjung from '../module/dashboard/Pengunjung';
import Pengguna from '../module/dashboard/Pengguna';

const routingList =[
    {
        'path': '/pengunjung',
        'component': 'Pengunjung',
        'layout': 'Layout'
    },
    {
        'path': '/pengunjung',
        'component': 'Pengunjung',
        'layout': 'Layout'
    },
];


const AppRoute = ({component:Component, layout:Layout, title:Title, ...rest})=>
(
    <Route {...rest} render={props=>(
        <Layout>
            <Component {...props}></Component>
        </Layout>
    )}>

    </Route>
)

// const mappingRoute = 

class RouterApp extends Component{
    render(){
        return(
            <Router>
                <Switch>
                    <AppRoute path='/' layout={Layout} exact title="Dashboard Pengunjung" component={Pengunjung} />
                    <AppRoute path='/pengunjung' layout={Layout} component={Pengunjung} />
                    <AppRoute path='/pengguna' layout={Layout} component={Pengguna} />
                </Switch>
            </Router>
        );
    }
}

export default RouterApp;
